import React, { Component } from "react";
import PokemonList from "../pokemon/PokemonList";

export default class Dashboard extends Component {
  render() {
    return (
      <div className="row">
        <div className="col">
          <PokemonList generations={"5"} />
        </div>
      </div>
    );
  }
}
